function Home() {
    
    return (
      <div>
        <div className="row">
          <div className="wrapper">
            <div className="col-6">
            <button className="login">Login</button>
            </div>
            <button className="signup">Signup</button>
          </div>
        </div>
      </div>
    );
  }
  
  export default Home;
